import styled from "styled-components";
import { colors, rawColors } from "../locales/colors";

export const MainMenuBox = styled.div`
  background-color: ${colors.buttonbgUnact};
  height: 50px;

  width: 50px;
  top: 0;
  display: flex;
  justify-content: center;
  z-index: 10;
  box-shadow: 0 2px 20px 0;
`;
